import {Parallax, ParallaxLayer} from 'react-spring/renderprops-addons'
import React from 'react'
import './nef.svg'
import './sumka.svg'
import {FaBars} from 'react-icons/fa';

import { Switch, Route ,Link} from 'react-router-dom';
import MenuButton from "../MenuButton/MenuButton";
import svg from "../MenuButton/MenuCont"
const url = (name, wrap = false) => `${wrap ? 'url(' : ''}https://awv3node-homepage.surge.sh/build/assets/${name}.svg${wrap ? ')' : ''}`;
// const url = (name, wrap = false) => `${wrap ? 'url(' : ''}${name}.svg${wrap ? ')' : ''}`;
class ParallaxMy extends React.Component {
    render() {
        return (
            <Parallax pages={2} scrolling={true} vertical ref={ref => (this.parallax = ref)}>
                <div>
                <ParallaxLayer offset={1} speed={0} style={{ backgroundColor: '#000000' }} />
                <ParallaxLayer offset={2} speed={0} style={{ backgroundColor: '#adc59d' }} />

                <ParallaxLayer
                    offset={0}
                    speed={0}
                    onClick={() => this.parallax.scrollTo(1)}
                    style={{backgroundImage: 'url(' + require('./nefritis2.svg') + ')', backgroundSize: 'cover' ,display: 'flex', alignItems: 'center', justifyContent: 'top' }}>
                    <div>

                        <Link to="/signup">
                            <MenuButton icon={<FaBars/>}/>

                        </Link>
                        <Link to="/signup">
                            <button variant="outlined">
                                Shop
                            </button>
                        </Link>
                        <Link to="/about2">
                            <button variant="outlined" className="btn btn-danger">
                                Counter
                            </button>
                        </Link>
                    </div>
                    {/*<img src={url('bash')} style={{ width: '40%' }} />*/}
                </ParallaxLayer>
                <ParallaxLayer
                    offset={1}
                    speed={0}
                    onClick={() => this.parallax.scrollTo(0)}
                    style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                    {/*<img src={url('clients-main')} style={{ width: '40%' }} />*/}
                </ParallaxLayer>
                    <ParallaxLayer offset={1.6} speed={-0.1} style={{ opacity: 0.4 }}>
                        <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '60%' }} />
                        <img src={url('cloud')} style={{ display: 'block', width: '25%', marginLeft: '30%' }} />
                        <img src={url('cloud')} style={{ display: 'block', width: '10%', marginLeft: '80%' }} />

                    </ParallaxLayer>

                    <ParallaxLayer offset={1.3} speed={0.4} style={{ opacity: 0.6 }}>

                        <img src={'url(' + require('./sumka.svg') + ')'} style={{ display: 'block', width: '20%', marginLeft: '5%' }} />
                        <img src={'url(' + require('./sumka.svg') + ')'} style={{ display: 'block', width: '15%', marginLeft: '75%' }} />
                    </ParallaxLayer>


                    <ParallaxLayer
                        offset={1}
                        speed={0}
                        style={{ display: 'block', alignItems: 'center', justifyContent: 'center' }}
                        onClick={() => this.parallax.scrollTo(0)}>
                    </ParallaxLayer>




                </div>
            </Parallax>

        )
    }
}
export  default ParallaxMy;
